import React from "react";
import {
  Container,
  Typography,
  Card,
  CardContent,
  Button,
  Select,
  MenuItem,
  FormControl,
  InputLabel,
  Grid,
  IconButton,
  Divider
} from '@mui/material';
import { List, ListItem, ListItemText } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import ExitToAppIcon from '@mui/icons-material/ExitToApp';
import AccountBalanceWalletIcon from '@mui/icons-material/AccountBalanceWallet';
import GroupIcon from '@mui/icons-material/Group';
import GroupAddIcon from '@mui/icons-material/GroupAdd';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import RuleIcon from '@mui/icons-material/Rule';
import HelpOutlineIcon from '@mui/icons-material/HelpOutline';
import SecurityIcon from '@mui/icons-material/Security';
import AssignmentIcon from '@mui/icons-material/Assignment';
import FooterMenu from '../Footer.jsx';

const QuantitativeTrading = () => {

 const [filter, setFilter] = useState('All');
  const [menuOpen, setMenuOpen] = useState(false);

  const handleFilterChange = (event) => setFilter(event.target.value);
  const handleViewTeamList = () => navigate('/team-list');
  const toggleMenu = () => setMenuOpen(!menuOpen);
  const logout = () => {
    // Add your logout logic here
  };



  return (
    <div className="p-4 grid gap-6">
      <h1 className="text-2xl font-bold">Quantitative Trading</h1>

      {/* Funds Section */}
      <div className="grid grid-cols-1 sm:grid-cols-3 gap-4">
        <Card>
          <CardContent className="p-4">
            <p className="text-gray-500">Funds</p>
            <p className="text-xl font-bold">5.00 USDT</p>
            <p className="text-sm text-gray-400">0.00</p>
          </CardContent>
        </Card>

        <Card>
          <CardContent className="p-4">
            <p className="text-gray-500">Today's Earnings</p>
            <p className="text-xl font-bold">0.00</p>
          </CardContent>
        </Card>

        <Card>
          <CardContent className="p-4">
            <p className="text-gray-500">Monthly Income</p>
            <p className="text-xl font-bold">0.00</p>
            <p className="text-sm text-gray-400">Total Income</p>
            <p className="text-xl font-bold">0.00</p>
          </CardContent>
        </Card>
      </div>

      {/* Team Section */}
      <div className="grid grid-cols-1 sm:grid-cols-3 gap-4">
        <Card>
          <CardContent className="p-4">
            <p className="text-gray-500">Today's Team</p>
            <p className="text-xl font-bold">0.00</p>
          </CardContent>
        </Card>

        <Card>
          <CardContent className="p-4">
            <p className="text-gray-500">Team of the Month</p>
            <p className="text-xl font-bold">0.00</p>
          </CardContent>
        </Card>

        <Card>
          <CardContent className="p-4">
            <p className="text-gray-500">Team Income</p>
            <p className="text-xl font-bold">0.00</p>
          </CardContent>
        </Card>
      </div>

      {/* Quantization Start Message */}
      <Card>
        <CardContent className="p-4 text-center">
          <p className="mb-2">To start quantization please fill up your account!</p>
          <Button>Recharge Now</Button>
        </CardContent>
      </Card>

      {/* VIP Level Section */}
      <div className="mt-6">
        <h2 className="text-xl font-semibold mb-4">VIP Level</h2>
        <Card>
          <CardContent className="p-4">
            <div className="flex flex-col sm:flex-row items-center gap-4">
              <img
                src="/vip0-card.png"
                alt="VIP0 Card"
                className="w-full sm:w-64 rounded-xl shadow"
              />
              <div className="text-sm text-gray-600 space-y-1">
                <p className="text-lg font-bold">VIP0 Upgrade conditions</p>
                <p>Balance: 3 ~ 30 U</p>
                <p className="mt-2 text-lg font-bold">VIP0 Benefits</p>
                <p>Minimum Quantization Quantity: 3</p>
                <p>Maximum Quantization Quantity: 30</p>
                <p>Quantification Times per Day: 2 times</p>
                <p>Daily Rate: 1.00% ~ 2.00%</p>
              </div>
            </div>
          </CardContent>
        </Card>
      </div>
    </div>
  );
};

export default QuantitativeTrading;
